export let DisplayPokemons = ({pokemons}) => {
    if (pokemons === undefined) return
    return (
        <div className="container">
            {/*<img src={pokemonImage} ></img>*/}
              <tr>
                <td>number</td>
                <td>name</td>
                <td>total</td>
              </tr>
            {pokemons.map(p => {

                return <div>

                    <h4>{p.name}</h4>
                    <ul key={p.number}>

                        {p.name(k,v => {
                             <li>{k}: {v}</li>
                        })}

                    </ul>
                </div>
            })}
        </div>
    );
}
